import React from 'react';

const ContactPage = () => (
	<div style={{ fontSize: '20px', textAlign: 'center' }}>
		<div>
			Hi, my name is Nguyen Quoc Khanh.Hi, this is just my portfolio. . I'm a
			front-end developer.
		</div>
		<a href="mailto:quockhanhnguyen.it@gmail.com" style={{ display: 'block' }}>
			Email: quockhanhnguyen.it@gmail.com
		</a>
		<a href="https://github.com/khanhcoluy" style={{ display: 'block' }}>
			Github: github.com/khanhcoluy
		</a>
	</div>
);

export default ContactPage;
